import React from 'react';
import { Jumbotron } from 'react-bootstrap/Jumbotron';
import { Row } from 'react-bootstrap/Row';

import { Col } from 'react-bootstrap/Jumbotron';


function Hero(props) {
    return(
        <Jumbotron>
            <Container>
                <Row>
                    <Col>
                        <h2>
                            Bryan Ge
                        </h2>
                    </Col>
                </Row>
            </Container>
        </Jumbotron>
    );
}

export default Hero;
